import React, {useState} from 'react';

const ViewObject = ({ valObject }) => {
    const keys = Object.keys(valObject);
    const [expanded, setExpanded] = useState(false);
    const handleClick = () => {
        setExpanded(!expanded);
    };

    const parseObject = ({key, value}) => {
        if (typeof value === 'string' || typeof value === 'number' || typeof value === 'boolean') {
            return (
                <div>
                    <span>{key}: </span>
                    <span>{value}</span>
                </div>
              )
        } else if (typeof value === 'object') {
            return (
                <div style={{marginLeft: '5px'}}>
                    <button onclick={handleClick}>{key}:</button>
                    { console.log(expanded) && expanded ?
                        <span><ViewObject valObject={value} /></span>
                        :
                        <span>...</span>
                    }
                </div>
            )
        } else {
            return null;
        }
    };
    return (
        <div>
            { keys.map(key => {
              return parseObject({key, value: valObject[key]});
            })}
        </div>
    );
}

export default ViewObject;
